import Movie from './components/Movie.jsx'
import { dummy } from './movieDummy.js'

function App() {
  // title overview
  return (
    <div >
      <div className='app-container'>
        {
          // item = results 의 각각의 요소
          dummy.results.map((item) => {
            return <Movie
              key={item.id}
              title={item.title}
              poster_path={item.poster_path}
              vote_average={item.vote_average} />
          })
        }
      </div>
    </div>
  );
}

export default App;
